import React from 'react';
import ProjectCard from '../components/ProjectCard';
import './Projects.css';


function Projects() {    
    return (
        <div id="project-page">
            <h2 class="project-header">some projects i've done</h2>

            <div id="project-list"> 
                <ProjectCard
                    title = "Hog Dice Game"
                    text = "Used Python to develop a simulator of a two-player dice game; emphasized use of recursion and data abstraction."
                    githubLink = "#"
                >
                </ProjectCard>

                <ProjectCard
                    title = "Hog Dice Game"
                    text = "Used Python to develop a simulator of a two-player dice game; emphasized use of recursion and data abstraction."
                    githubLink = "#"
                >
                </ProjectCard>
            </div>



            </div>



    );
    }

export default Projects;
